 *  Usage:
 *
      <div class="spinner-rotating-plane"></div>
 *
 */
.spinner-rotating-plane {
  position: fixed;
  width: 80px;
  height: 80px;
  top: 50%;
  left: 50%;
  margin: -40px -40px;
  background-color: #ccc;
  -webkit-animation: spinner-rotate-plane 1.2s infinite ease-in-out;
  -moz-animation: spinner-rotate-plane 1.2s infinite ease-in-out;
  -ms-animation: spinner-rotate-plane 1.2s infinite ease-in-out;
  animation: spinner-rotate-plane 1.2s infinite ease-in-out; }

@-webkit-keyframes spinner-rotate-plane {
  0% {
    -webkit-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    -moz-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    -ms-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    transform: perspective(120px) rotateX(0deg) rotateY(0deg); }
  50% {
    -webkit-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    -moz-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    -ms-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg); }
  100% {
    -webkit-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    -moz-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    -ms-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg); } }

@keyframes spinner-rotate-plane {
  0% {
    -webkit-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    -moz-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    -ms-transform: perspective(120px) rotateX(0deg) rotateY(0deg);
    transform: perspective(120px) rotateX(0deg) rotateY(0deg); }
  50% {
    -webkit-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    -moz-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    -ms-transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg);
    transform: perspective(120px) rotateX(-180.1deg) rotateY(0deg); }
  100% {
    -webkit-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    -moz-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    -ms-transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg);
    transform: perspective(120px) rotateX(-180deg) rotateY(-179.9deg); } }

/**
 *  Aurelia layout basics
 */
body {
  background: #222222;
  margin: 0; }

.page-host {
  position: absolute;
  left: 0;
  right: 0;
  top: 85px;
  bottom: 0;
  padding-top: 36px;
  overflow-x: hidden;
  overflow-y: auto; }

section {
  margin: 0 20px; }

/**
 *  Page transition animations
 */
section.au-enter-active {
  -webkit-animation: fadeInRight 0.4s;
  -moz-animation: fadeInRight 0.4s;
  -ms-animation: fadeInRight 0.4s;
  animation: fadeInRight 0.4s; }

div.au-stagger {
  /* 50ms will be applied between each successive enter operation */
  -webkit-animation-delay: 50ms;
  -moz-animation-delay: 50ms;
  -ms-animation-delay: 50ms;
  animation-delay: 50ms; }

/* Animation definitions */
@-webkit-keyframes fadeInRight {
  0% {
    opacity: 0;
    -webkit-transform: translate3d(100%, 0, 0);
    -moz-transform: translate3d(100%, 0, 0);
    -ms-transform: translate3d(100%, 0, 0);
    transform: translate3d(100%, 0, 0); }
  100% {
    opacity: 1;
    -webkit-transform: none;
    -moz-transform: none;
    -ms-transform: none;
    transform: none; } }

@keyframes fadeInRight {
  0% {
    opacity: 0;
    -webkit-transform: translate3d(100%, 0, 0);
    -moz-transform: translate3d(100%, 0, 0);
    -ms-transform: translate3d(100%, 0, 0);
    transform: translate3d(100%, 0, 0); }
  100% {
    opacity: 1;
    -webkit-transform: none;
    -moz-transform: none;
    -ms-transform: none;
    transform: none; } }

body {
  font-variant-ligatures: none !important; }

.page-layout {
  position: relative;
  min-height: 100%; }

.page-content {
  padding: 0 0 60px; }

/**
 * Panels
 */
.panel-fixed-height {
  overflow-y: scroll; }

.panel-fixed-max-height {
  overflow-y: auto; }

/**
 * Tables
 */
table.table {
  margin-bottom: 0; }
  table.table tbody > tr > td {
    padding: 0 3px; }
  table.table.table-center th,
  table.table.table-center td {
    text-align: center; }
  table.table.table-fixed {
    table-layout: fixed; }
  table.table.table-parameter > tr > td:first-child,
  table.table.table-parameter > tbody > tr > td:first-child {
    width: 40%; }
  table.table.table-parameter-tiered > tr > td,
  table.table.table-parameter-tiered > tbody > tr > td {
    padding: 3px; }
    table.table.table-parameter-tiered > tr > td:first-child,
    table.table.table-parameter-tiered > tbody > tr > td:first-child {
      width: 15%; }
      table.table.table-parameter-tiered > tr > td:first-child + td,
      table.table.table-parameter-tiered > tbody > tr > td:first-child + td {
        width: 25%; }
  table.table > thead > tr > th {
    font-size: 16px;
    line-height: 1;
    text-align: center;
    vertical-align: middle; }
  table.table > thead.header-gap + tbody:before {
    content: '.';
    color: transparent;
    display: block;
    line-height: 1; }

.table-responsive-lg table.table {
  overflow-x: auto;
  min-height: 0.01%; }
  @media screen and (max-width: 1200px) {
    .table-responsive-lg table.table {
      width: 100%;
      overflow-y: hidden;
      -ms-overflow-style: -ms-autohiding-scrollbar; } }
.compare-hint-dialog ai-dialog-body {
  width: 400px; }
  .compare-hint-dialog ai-dialog-body .icon-pages:before {
    position: relative;
    top: -0.06em;
    left: -0.01em; }
  .compare-hint-dialog ai-dialog-body .icon-add-multi:before {
    position: relative;
    top: -0.02em;
    left: -0.02em; }

.compare-hint-dialog ai-dialog-footer button ~ button {
  margin-left: 7px; }

.compare-hint-dialog ai-dialog-footer button i {
  font-size: 16px;
  vertical-align: text-bottom;
  /* Collapse margins of caret icons into button padding a bit */ }
  .compare-hint-dialog ai-dialog-footer button i.icon-caret-left {
    margin-left: -5px; }
  .compare-hint-dialog ai-dialog-footer button i.icon-caret-right {
    margin-right: -5px; }
.load-report-dialog ai-dialog-body {
  width: 400px; }

.load-report-dialog ul {
  margin-left: 0;
  padding-left: 1.5em; }

.load-report-dialog table {
  margin-bottom: 10px; }
  .load-report-dialog table td.missing-component {
    width: 40%; }
  .load-report-dialog table td.missing-reason {
    width: 60%;

  100% {
    opacity: 0; } }

@keyframes fadeOut {
  0% {
    opacity: 1; }
  100% {
    opacity: 0; } }
.status-icon.text-default {
  color: #fff; }
.wizard {
  width: 100%; }
  .wizard > .steps {
    position: relative;
    display: block;
    width: 100%; }
    .wizard > .steps > ul {
      display: table;
      table-layout: fixed;
      width: 100%;
      margin: 0;
      padding: 0;
      list-style: none; }
      .wizard > .steps > ul > li {
        position: relative;
        display: table-cell;
        width: auto;
        vertical-align: top;
        text-align: center;
        /* Generate half-width connector lines to either side of each step marker
           Splitting prevents connector for incomplete step from overlaying
             circle for completed step (they'd be different colors)
        */
        /* Set connectors to their respective sides */
        /* Fade connectors for non-completed steps */
        /* Highlight current step marker */
        /* Highlight completed step markers */ }
        .wizard > .steps > ul > li:not(:first-child):before, .wizard > .steps > ul > li:not(:last-child):after {
          content: '';
          position: absolute;
          display: block;
          top: 40px;
          width: calc(50% - 20px);
          height: 2px;
          background-color: #3498DB;
          transition: background-color 0.2s ease-in-out; }
        .wizard > .steps > ul > li:after {
          left: calc(50% + 20px); }
        .wizard > .steps > ul > li.current:after,
        .wizard > .steps > ul > li.current ~ li:before,
        .wizard > .steps > ul > li.current ~ li:after {
          background-color: #464545; }
        .wizard > .steps > ul > li.current > a > span {
          border-color: #3498DB; }
        .wizard > .steps > ul > li.done > a > span {
          border-color: #3498DB; }
        .wizard > .steps > ul > li > a {
          position: relative;
          display: block;
          padding-top: 50px;
          margin: 20px 0;
          color: #fff;
          text-decoration: none; }
          .wizard > .steps > ul > li > a > span {
            position: absolute;
            display: inline-block;
            top: 0;
            left: 50%;
            height: 40px;
            width: 40px;
            margin-left: -20px;
            color: #fff;
            font-size: 20px;
            line-height: 38px;
            text-align: center;
            border: 2px solid #464545;
            border-radius: 50%;
            transition: border-color 0.2s ease-in-out; }
.about .well {
  padding-bottom: 40px; }
  .about .well .row {
    max-width: 100%; }

.about h1 {
  margin-bottom: 21px; }

.about .about-subscript {
  font-size: 13px;
  color: #aaa; }

.about hr {
  margin: 40px 0; }

.about td.resource-block {
  padding: 2px 15px 2px 0px;
  line-height: 15px;
  vertical-align: top; }

.about .resource-title {
  font-size: 13px; }

.about .resource-version {
  color: #aaa;
  font-size: 11px;
  vertical-align: top; }
.inventory .row + .row:before {
  content: ' ';
  height: 1px;
  width: calc(100% - 30px);
  margin: 0 15px 20px;
  background-color: #4774a2; }
@media (min-width: 1200px) {
  .table-overview-log .log-timestamp {
    width: 33%; } }

@media (max-width: 1199px) {
  .table-overview-log .log-timestamp {
    width: 25%; } }
table.table-job-result {
  background-color: #282828 !important;
  margin: 5px 0; }
  table.table-job-result tbody tr td {
    padding: 2px 7px; }
th .th-subhead {
  font-size: 13px; }
